const Carousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  }
  return (
    <div>
      <div>
        <h2 className={styles.test}> Single Item</h2>
      </div>
    </div>
  )
}

export default Carousel
